import React from 'react';
import styles from './index.module.scss';



export class GoodsShow extends React.Component<any, any> {
    constructor(props) {
        super(props);
        this.state = {
            click: false,
        }
    }
    handleClick(click) {
        this.setState({click: !click})
        return click;
    }

    render() {
        return (
            <div>
                <div className={this.state.click ? styles.bigImg : styles.img} onClick={() => this.handleClick(this.state.click)}></div>
                <div className={styles.content}></div>
            </div>
        );
    }
}
